@mixin onTablet {
  @media (min-width: 744px) {
    @content;
  }
}

@mixin onDesktop {
  @media (min-width: 1024px) {
    @content;
  }
}

@mixin top-actions {
  display: grid;
  grid-template-columns: 1fr #{$icon-width} #{$icon-width};
  justify-items: start;
  align-items: center;
  gap: 30px;

  @include onTablet {
